const Hero = () => {
	return (
		<div className='jumbotron p-0'>
			<div className='container'>
				<div className='row hero-container align-items-center'>
					<div className='col-4 mr-5  '>
						<h1 className='hero-title'>
							Herzlich willkommen in unserer Praxis
						</h1>
					</div>
					<div className='col d-flex'>
						<img
							className='rounded align-self-end img-fluid'
							src='https://image.freepik.com/free-photo/female-patient-smiling-clinic_107420-65294.jpg'
						></img>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Hero;
